transforms.result:
.paper {
  position: relative;
  overflow: hidden;
  margin-bottom: var(--mantine-spacing-3xl);
  border-radius: var(--mantine-radius-5xl);
  padding-top: var(--mantine-spacing-5xl);
  padding-bottom: 255px;

  @mixin data-color 2;

  @mixin larger-than 1150px {
    margin-bottom: 80px;
    border-radius: 80px;
    padding-top: 0;
    padding-bottom: 0;
    padding-left: 123px;
    height: 400px;
  }
}

.stack {
  position: relative;
  z-index: 100;
  justify-content: center;
  text-align: center;
  gap: var(--mantine-spacing-lg);

  @mixin larger-than 1150px {
    justify-content: center;
    height: 100%;
    text-align: left;
    gap: calc(var(--mantine-spacing-lg) / 2);
  }
}

.personalityType {
  font-size: 18px;

  @mixin larger-than 998px {
    font-size: 36px;
  }
}

.name {
  font-size: 32px;

  @mixin larger-than 998px {
    font-size: 56px;
    line-height: 65px;
  }
}

.type {
  font-size: 18px;

  @mixin larger-than 998px {
    font-size: 36px;
    line-height: 42px;
  }
}

.image {
  position: absolute;
  right: 0;
  top: 100px;
  width: 364px;
  height: 364px;
  object-fit: contain;

  &.desktop {
    display: none;
  }

  @mixin larger-than 768px {
    right: 0;
    top: -144px;
    width: 680px;
    height: 680px;

    &.desktop {
      display: block;
    }

    &.mobile {
      display: none;
    }
  }

  @mixin banner-circle-color 4;
}

.character {
  position: absolute;
  left: 50%;
  bottom: 0;
  z-index: 1;
  width: 247px;
  height: 247px;
  transform: translateX(-50%);

  @mixin larger-than 1200px {
    left: unset;
    right: -150px;
    bottom: 0;
    width: 400px;
    height: 380px;
    object-fit: contain;
  }
}

